import React from 'react'

export default function Table(props){
    return(
        <table>
            <thead>
                <tr>
                    <th>#</th>
                    <th>Name</th>
                    <th>Year</th>
                </tr>
            </thead>
            <tbody>
            {
            props.data.map(row => (
                <tr>
                    <td>{row.id}</td>
                    <td>{row.name}</td>
                    <td>{row.year}</td>
                </tr>
            ))
            }
            </tbody>
        </table>
    )
};
